import { AppBar, Toolbar } from "@mui/material";
import { Typography } from "@mui/material";
import { Link } from "react-router-dom";
import Button from "@mui/material/Button";

export default function MyAppBar(){

    return(

        //the login link button will be username or mystuff when logged in. Some sort of function
        <div>
            <AppBar position="static">
                <Toolbar sx={{backgroundColor:"sandybrown"}}>
                  <Grid container sx={{justifyContent: 'center', display: 'flex',
                  alignItems: 'center'}}>
                    <Grid xs={4}/>
                    <Grid xs={4}>
                      <Typography variant="h4" sx={{margin:2}}>Breakfast Lord</Typography>
                    </Grid>
                    <Grid xs={4}>
                      <Link  style={{ textDecoration: 'none' }} to={'/listings'}>
                        <Button variant="contained" sx={{justifyContent:'right', marginRight: 3, backgroundColor:"lightsalmon"}}>View Listings</Button>    
                      </Link>
                      <Link  style={{ textDecoration: 'none' }} to={'/login'}>
                        <Button variant="contained" sx={{justifyContent:'right', backgroundColor:"lightsalmon"}}>Login</Button>    
                      </Link>
                    </Grid>
                  </Grid>
                </Toolbar>
            </AppBar>
        </div>
    )

}
